Views have all been created, now working on creating the KNOWWHO-NOVF connection table based on Kate's old design.
Query thus far is:
SELECT ms.PID as 'PID' ,ms.FirstName as 'FirstName' ,ms.MiddleName as 'MiddleName' ,ms.LastName as 'LastName' ,m.PartyCode as 'PartyCode' ,us.Voters_OfficialRegDate as 'Registration' ,us.LALVOTERID as 'LALVOTERID' ,us.Voters_FirstName as 'Voters_FirstName' ,us.Voters_MiddleName as 'Voters_MiddleName' ,us.Mailing_Addresses_AddressLine ,us.Mailing_Addresses_ExtraAddressLine ,us.Mailing_Addresses_City ,us.Mailing_Addresses_State ,us.Mailing_Addresses_Zip ,us.Mailing_Addresses_ZipPlus4 ,mb.BirthYear as 'DOB_Year' ,p.Description as 'Party_Affiliation' ,us.General_Frequency as 'Voter_Frequency_General' ,us.Primary_Frequency as 'Voter_Frequency_Primary' ,YEAR(us.Voters_BirthDate) as 'BirthYear' FROM KNOWWHO_05_2017.MembersStaffers ms LEFT JOIN KNOWWHO_05_2017.Members m ON ms.MEMID = m.MEMID LEFT JOIN KNOWWHO_05_2017.MembersBackground mb ON ms.MEMID = mb.MEMID LEFT JOIN KNOWWHO_05_2017.PartyLUT p ON m.PartyCode = p.PartyCode LEFT JOIN NOVF_2017_Q1.US us ON ms.FirstName = us.Voters_FirstName AND ms.LastName = us.Voters_LastName;
